import { IconButton, View } from "native-base";
import React from "react";
import { Button } from "react-native";


export default function UrgentList({filteredUrgent}) {
  return (
      <View>
      <IconButton onPress={filteredUrgent}>Urgent</IconButton>
    </View>
  );
}
